import React, {Component} from 'react'
import {Card, Avatar} from 'antd';
import { EditOutlined, DeleteOutlined } from '@ant-design/icons';

/*
左侧导航的组件
 */
const { Meta } = Card 

export default class FavouritesCard extends Component{
    state = {
        loading: false
    }

    render(){
        const {loading} = this.state
        const {address, title, description} = this.props
        console.log(this.props.address+"/favicon.ico")
        return(
            <Card style={{ width: 300}}
            actions={[
                <EditOutlined key="edit" />,
                <DeleteOutlined key="delete" />,
            ]}
            hoverable={true}
            loading={loading}
            >
                <Meta
                avatar={<Avatar size="large" shape="square" src={address+"favicon.ico"} />}
                title={title}
                description={description}
                onClick={()=>{window.open(address)}}
                />
            </Card>
        )
    }
}
